    - 1979",nt"tracking_summary": {ntt"total": 3,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T23:03:47.301938",nt"name":
    "hunting-plan-for-migratory-birds-and-big-game-at-hillside-national-wildlife-refuge-1979",nt"isopen":
    false,nt"url": null,nt"notes": "Refuge habitat types are dominated by bottom
    land hardwoods interspersed with bald cypress/tupelo-sloughs and "brakes" (Type
    7 wetlands) in the wetter areas and buttonbush, water elm, swamp privet, and willow
    (Type 6 wetlands) in the more shallow depressions. Adjoining refuge land totaling
    3,573 acres is in agricultural production under the Service's cooperative farming
    program.  The fauna is diverse with many popular and important species present.
    Refuge wetlands are noted for large waterfowl wintering populations. Mallards are
    the most numerous species with wigeon, pintail, green-winged teal, and wood ducks
    being common. Waterfowl concentrations of up to 125,000 have been observed in recent
    years. Vast acreages of agricultural land in the Yazoo Basin attract high concentrations
    of mourning dove. This species has probably suffered less from changing agricultural
    practices than any other. Numerous species of shore birds and other migratory and
    resident birds utilize the refuge. Gray and fox squirrels, white-tailed deer, swamp
    and cottontail rabbit, raccoon, and bobwhite quail are the principal resident game
    species. Common furbearing species include nutria, beaver, raccoon, muskrat, and
    bobcat. The endangered American alligator occurs naturally on the refuge and the
    southern bald eagle, also endangered, is an occasional winter visitor.",nt"license_title":
